        function initPhoneInputPatternForCountry(countryCode) {
            var northCountryPattern = "^\\s*(?:\\+?(\\d{1,3}))?[-. (]*(\\d{3})[-. )]*(\\d{3})[-. ]*(\\d{4})\\s*$";
            var otherCountryPattern = "^\\s*(?:\\+?(\\d{1,3}))?[-. (]*(\\d{1,6})[-. )]*(\\d{2,4})[-. ]*(\\d{4,6})\\s*$";
            var phoneNumberInput = $('#postFormId input#phonenumber');

            if (countryCode == 1){
                phoneNumberInput.prop('pattern', northCountryPattern);
                phoneNumberInput.data('phoneMaxLength', "11");
            } else {
                phoneNumberInput.prop('pattern', otherCountryPattern);
                phoneNumberInput.data('phoneMaxLength', "15");
            }
        }
        function initPrefixPhoneInput(htmlElement) {
            var countryCode = htmlElement ? $(htmlElement).attr('data-phonecode') : null;

            if (countryCode == 1) { //path#5 add not-editable gray digits for country code non-North-American
                $('#postFormId input#countrycode')
