        $(document).ready(function () {
            if(!postingInUSA  && !(/posts\/create/.test(location.href) || /posts\/edit/.test(location.href))) {
                $('#choseCityContainer>.ac-sub:eq(1)>article').html('');
                $('#choseCityContainer>.ac-sub:eq(1)').on('click', function () {
