        if (/posts\/create/.test(location.href) || /posts\/edit/.test(location.href)) { //path#4 city clicking on post page
            if(/posts\/edit/.test(location.href)) {
                var countryCode = $("#countrycode").val();
                initPhoneInputPatternForCountry(countryCode);
            }
            initPrefixPhoneInput();
            
            $('article.ac-sub-text > p > a').on('click tap', function ($e) { // write city to input and close select window
                var countryCode = $(this).attr('data-phonecode');
                var countryName = $(this).attr('data-country-name');
                var startAge = Number($('select#age').find('option:eq(1)').val());

                if (countryName === 'Canada' && startAge != AGE_LIMIT_CANADA) { // change age select when choosing city in post form
                    for (var i = AGE_LIMIT_EUROPE; i >= AGE_LIMIT_CANADA; i--) {
                        $('select#age option:eq(0)').after('<option value="' + i + '">' + i + '</option>');
                    }
                    $('select#age option:eq(0)').prop('selected', true);
                } else if (countryName !== 'Canada' && startAge != AGE_LIMIT_EUROPE) {
                    for (var i = AGE_LIMIT_EUROPE; i >= AGE_LIMIT_CANADA; i--) {
                        $('select#age option:eq(1)').remove();
                    }
                    $('select#age option:eq(0)').prop('selected', true);
                }
                
                $e.preventDefault();
                // $('#phonenumber').val('');
                phoneNumberMask.updateValue();
                $('#cityName').val($(this).text())
                    .text($(this).attr('href').split('/')[2]);  // city name -> val; city id -> input content text
                $('#cityId').val($(this).attr('href').split('/')[2]);
                $('#countrycode').val(countryCode); // country code
                $('#cityChoicePopUpContainer').hide();

                initPhoneInputPatternForCountry(countryCode);
                initPrefixPhoneInput(this);
            });
        }
